		fontSize: '80px',
		fontWeight: '1000',
		display: 'block', 
		margin: '0 0 100px 0',
		color: 'rgb(111, 186, 13)'
	}
	const [countTrees,setCountTrees] = useState(15342)
	return (
		<div className="tree-counter">
			<span style={count_css}>{count}</span>
			<span style={x_css}>trees planted</span>
		</div>
	);
}

